import React from "react";
import Data from "../data.json";

function Card() {
  console.log(Data);
  return (
    <div className="bg-gray-300 sm:mt-[-10px] md:w-[50%] mx-auto md:flex md:mt-[12%] text-center rounded-xl bg-Paleblue font-Hanken">
      <div className="mx-5 md:mx-0 md:w-[50%] pt-5 bg-Cobaltblue rounded-xl  text-White">
        <h1>Your Result</h1>
        <div className="rounded-[100%] w-[100px] h-[100px] bg-Lightroyalblue mx-auto my-4">
          <section className="text-center pt-5">
            <p className="text-4xl font-bold">76</p>
            <p>of 100</p>
          </section>
        </div>
        <h2>Great</h2>
        <p className="mx-4 pb-5">
          You scored higher than 65% of the people who have taken these tests.
        </p>
      </div>
      <div className="mx-5 md:w-[50%] pt-5 ">
        <p className="text-start w-[80%] mx-auto">Summary</p>
        {Data.map((item, key) => {
          return (
            <div
              key={key}
              className="flex my-5 justify-center w-[80%] mx-auto bg-Orangeyyellow rounded-md"
            >
              <img src={item.icon} alt={item.category} />
              <p className="mx-4">{item.category}</p>
              <p>{item.score}/100</p>
            </div>
          );
        })}
        <button className="rounded-xl w-[50%] text-white bg-Lightslateblue text-White font-semibold h-[33px] my-5 hover:cursor-pointer">
          Continue
        </button>
      </div>
    </div>
  );
}

export default Card;
